$(function() {

$(".sky-mega-menu").after("<div id='my-menu'>");
$(".sky-mega-menu").clone().appendTo("#my-menu");
$("#my-menu").find("*").attr("style","");    
$("#my-menu").find("ul").removeClass("sky-mega-menu"); 
$("#my-menu").mmenu({
  extensions: [ 'effect-menu-slide', 'pagedim-black', 'border-full'],
  navbar: {
   title: ""
  }
 });  
var api = $("#my-menu").data("mmenu");

$(".mobile-mnu").click(function(){
  var mmAPI = $("#my-menu").data("mmenu");
  mmAPI.open();
  var thiss = $(this).find(".toggle-mnu");
  thiss.toggleClass("on");
  $(".main-mnu").slideToggle();
  return false;   
});

	$(".s-adv").waypoint(function() {

    $({blurRadius: 5}).animate({blurRadius: 0}, {
      duration: 1200,
      easing: 'swing',
      step: function() {
        $(".s-adv-item h3 span").css({
          "-webkit-filter": "blur("+this.blurRadius+"px)",
          "filter": "blur("+this.blurRadius+"px)"
        });
      }
    });
    var comma_separator_number_step = $.animateNumber.numberStepFactories.separator(' ');
    $(".s-adv-item h3 span").each(function() {
      var tcount = $(this).data("count");
      $(this).animateNumber({ number: tcount,
        easing: 'easeInQuad',
        "font-size": "34px",
        numberStep: comma_separator_number_step},
        1200);
    });
    this.destroy();  

  }, {
    offset: '70%'
  });

$(function(){
    $("#phone1").mask("+38(999) 999-9999");
  });

$(window).scroll(function() {
if ($(this).scrollTop() > 1){  
    $('.mnu-line').addClass("sticky");
  }
  else{
    $('.mnu-line').removeClass("sticky");
  }
});

$(document).ready(function() {
	$('.popup-gallery').magnificPopup({
		delegate: 'a',
		type: 'image',
		tLoading: '',
		mainClass: 'mfp-zoom-in',

		gallery: {
			tCounter: '%curr%  %total%',
			enabled: true,
			navigateByImgClick: true,
			preload: [0,1] // Will preload 0 - before current, and 1 after the current image
		},
		zoom: {
    		enabled: true, // By default it's false, so don't forget to enable it

    		duration: 400, // duration of the effect, in milliseconds
    		easing: 'ease-in-out', // CSS transition easing function

    		// The "opener" function should return the element from which popup will be zoomed in
    		// and to which popup will be scaled down
   			// By defailt it looks for an image tag:
    		opener: function(openerElement) {
      		// openerElement is the element on which popup was initialized, in this case its <a> tag
      		// you don't need to add "opener" option if this code matches your needs, it's defailt one.
      		return openerElement.is('img') ? openerElement : openerElement.find('img');
    		}
  		}
		
	});
});



$('.partners').owlCarousel({
  loop: true,
  smartSpeed: 100,
  dots: true,
  nav: true,
  autoplay: true,
  autoplayTimeout: 5000,
  autoplayHoverPause: true,
  navText: ['<i class="fa fa-angle-left"></i>','<i class="fa fa-angle-right"></i>'],
  responsiveClass: true,
  responsive: {
    0: {
      items: 1
    },
    480: {
      items: 2
    },
    992: {
      items: 4
    },
    1920: {
      items: 6
    }
    
  }
});


});
$(window).on('load', function() {
  $('.preloader').delay(1000).fadeOut('slow')
});
